import SideBar from "../components/SideBar/Sidebar";
import Standings from "../components/standings/Standings";

const Main = () => {
	return (
		<>
			<SideBar />
			<div className="text-black flex flex-col p-4 sm:ml-64 gap-3">
				<Standings leagueId="61"/>
				<Standings leagueId="20"/>
			</div>
		</>
	);
};

export default Main;
